import React from 'react';

function Tweet() {
    return(
        <section>
            <div className='container-fluid'>
                <h1 className='mt-5'>Tweets</h1>
                <p>This is where the tweets will go, prob not.</p>
            </div>
        </section>
    );
}

export default Tweet;
